        <text>class PingPongMadre:
pass

class Ping(PingPongMadre):
def __init__(self, pong):
self.pong = pong

class Pong(PingPongMadre):
def __init__(self, pings=None):
if pings is None:
self.pings = []
else:
self.pings = pings
def add_ping(self, ping):
self.pings.append(ping)

pong = Pong()
ping = Ping(pong)
pong.add_ping(ping)</text>
